package LeetCode.Easy.ValidAnagram;

import java.util.HashMap;
import java.util.Map;

public class Solution {
    public static void updateMap(Map<Character,Integer> mp, char ch) {
        if (!mp.containsKey(ch)) mp.put(ch, 1);
        else mp.put(ch, mp.get(ch) + 1);
    }
    public static boolean isAnagram(String s, String t) {
        if (s.length()!=t.length()) return false;
        Map<Character, Integer> map_1 = new HashMap<>();
        Map<Character, Integer> map_2 = new HashMap<>();
        int i = 0;
        while (i < s.length()) {
            char ch1 = s.charAt(i), ch2 = t.charAt(i++);
            updateMap(map_1, ch1);
            updateMap(map_2, ch2);
        }
        if (map_1.size()!=map_2.size()) return false;
        for (Character key : map_1.keySet()) {
            if (!map_2.containsKey(key) || map_2.get(key)!=Math.sqrt(map_2.get(key)*map_1.get(key))) return false;
        }
        return true;
    }
    public static void main(String[] args) {
        String s = "anagram", t = "nagaram";
        String s2 = "rat", t2 = "car";
        String s3 = "";
        String t3 = "";
        System.out.println(isAnagram(s, t));
        System.out.println(isAnagram(s2, t2));
        System.out.println(isAnagram(s3, t3));
    }
}
